import React from "react";
//import styles from "../styles/cardComponent.module.css";


export default function DogCard({ name, image, temperament, weight }) {
    return (
        <div>
      <div>
        <div>
          <h3>{name}</h3>
        </div>
        <div>
          <img src={image} alt="img" width="200" height="150" />
          <h4>Peso min y max: </h4>
          <p>{weight}</p>
          <h4>Temperamentos:</h4>
          <p> {temperament.join(", ")}</p>
        </div>
      </div>
    </div>
    )
}
